data class Tree<T>(var value: T) {
    var left: Tree<T>? = null
    var right: Tree<T>? = null
    override fun toString(): String = "Tree(value=$value, left=$left, right=$right)"
}

@Test
fun foo() {

    val gson = Gson()

    val json = """{"value":-29,"left":{"value":95,"left":null,"right":null},"right":{"value":2,"left":null,"right":{"value":100,"left":null,"right":null}}}"""
    val tree: Tree<Int> = gson.fromJson(json, Tree::class.java) as Tree<Int>

    System.err.println("tree: $tree")
    val expected = listOf(-29, 95, 2, 100)
    val result = betterOrderTraversal(tree)
    assertEquals(expected, result)
}


private fun betterOrderTraversal(root: Tree<Int>): List<Int> {
    val preOrder: MutableList<Int> = preOrder(root, mutableListOf())
    return preOrder
}

private fun preOrder(node: Tree<Int>, results: MutableList<Int>): MutableList<Int> {
    results.add(node.value)
    node.left?.let { preOrder(it, results) }
    node.right?.let { preOrder(it, results) }
    return results
}

