fun Any?.getFieldValue(fieldName: String): Any? {
    var currentTarget = this
    if (DELIMITER in fieldName) {
        val parts = fieldName.split(DELIMITER)
        for (part in parts) {
            val matches = part.matches("\\d+".toRegex())
            currentTarget = if (matches && currentTarget is List<*>) {
                currentTarget[part.toInt()]
            } else {
                currentTarget.getFieldValue(part)
            }
        }

        return currentTarget
    }

    try {
        return currentTarget!!.javaClass.kotlin.memberProperties.first { it.name == fieldName }.get(currentTarget)
    } catch (e: NoSuchElementException) {
        throw NoSuchFieldException(fieldName)
